		//להצגת המסיחים
		function showQdistractors() {
			if (whosTurn) {
				theGame.getChildByName("mainCharacter0").gotoAndStop(2);
			} else {
				theGame.getChildByName("mainCharacter1").gotoAndStop(2);
			}
		
			var g_length = games[mychoice][2][q_index][3].length;
			var myArray = [];
			var counterArray = 0;
		
			for (i = 0; i < g_length; i++) {
				var distractors;
				distractors = whichDis(distractors, kindOfQ, i);
		
				distractors.name = "distractors" + i;
				qArea.addChild(distractors);
						distractors.cursor = "pointer";

				distractors.addEventListener("click", chooseDistractor);
				distractors.addEventListener("mouseover", hoverDistractor);
				distractors.addEventListener("mouseout", hoverDistractorOut);
				var rndDis = rndDistractors(); //מגריל משתנה להגרלת המסיח
				while (finaleRndDis(rndDis, myArray) != false) {
					rndDis = rndDistractors(); //מגריל משתנה להגרלת המסיח
				}
				myArray[counterArray] = rndDis;
				counterArray++;
		
				if (kindOfQ == 0 || kindOfQ == 2) {
		
					var distractorsTitle = new createjs.Text();
					distractorsTitle.font = qDistnStyle;
					distractorsTitle.text = games[mychoice][2][q_index][3][rndDis][0];
					distractorsTitle.textAlign = "right";
					distractorsTitle.name = "distractorsTitle";
					distractors.addChild(distractorsTitle);
		
				} else {
					createIMmg(games[mychoice][2][q_index][3][rndDis][0], distractors, kindOfQ);
				}
		
				if (games[mychoice][2][q_index][3][rndDis][1]) {
					correctIndex = i;
				}
			}
		}
		
		
		
		
		var disArray = [lib.distractors, lib.distractorsIMG, lib.distractors];
		
		//פונקציה שמקבלת מסיח,סוג ואינדקס ומחזירה את המיקום של המסיח
		function whichDis(distractors, kindOfQ, i) {
			distractors = new(disArray[kindOfQ])();
			var w = 725;
			var h = 47;
			if (kindOfQ == 0) {
				//text only
				distractors.x = 350;
				distractors.y = 60 * i - 60;
			} else if (kindOfQ == 1) {
				//img only
				distractors.x = 350 - (i * 180);
				distractors.y = 0;
				w = 170;
				h = 131;
			} else {
				//text + PIc in q
				distractors.x = 350;
				distractors.y = 60 * i - 30;
			}
			distractors.setBounds(distractors.x, distractors.y, w, h);
			return distractors;
		}
		
		//פונקציה אשר מגרילה מספר בטווח של 0 עד מקסימום המסיחים
		function rndDistractors() {
			var rnd = Math.floor((Math.random() * (games[mychoice][2][q_index][3].length)));
			return rnd;
		}
		
		//פונקציה שבודקת האם המספר הוגרל
		function finaleRndDis(rnd, myArray) {
			for (i = 0; i < myArray.length; i++) {
				if (myArray[i] == rnd) {
					return true;
				}
			}
		
			return false;
		}
		
		var currentDistractorClick;
		
		
		/*		-----		distractors	hover ,click, Check	-----		*/
		
