		//func calculate and return the grade of the Winner
		function gradeWinner(myErrors) {
			var grade = 100 - 2 * myErrors;
			if (grade < passScore) {
				grade = passScore;
			}
			return grade;
		}
		
		
		//func calculate and return the grade of the Losser
		function gradeLosser(vArea, lArea, myErrors) {
			var grade = 100 - (vArea / lArea) * 5 - (2 * myErrors);
			if (grade < passScore) {
				grade = passScore;
			}
			if (lArea == 0) {
				grade = 0;
		
			}
			return parseInt(grade);
		}
