		//func check who is thw winner and save the grade of each player;
		var winLoseSenc = ["!ניצחת", "..אולי בפעם הבאה", "תיקו"];
		function whoWinner() {
			if (counterArea[0] > counterArea[1]) {
				//p1 wins
				grades[0] = gradeWinner(counterError[0]);
				grades[1] = gradeLosser(counterArea[0], counterArea[1], counterError[1]);
				sentenceArray[0] = winLoseSenc[0];
				sentenceArray[1] = winLoseSenc[1];
				createCrown(1);
			} else if (counterArea[0] < counterArea[1]) {
				//p2 wins		
				grades[1] = gradeWinner(counterError[1]);
				grades[0] = gradeLosser(counterArea[1], counterArea[0], counterError[0]);
				sentenceArray[1] = winLoseSenc[0];
				sentenceArray[0] = winLoseSenc[1];
				createCrown(0);
		
			} else {
				//tie 
				grades[0] = gradeWinner(counterError[0]);
				grades[1] = gradeWinner(counterError[1]);
				if (grades[0] == grades[1]) {
					sentenceArray[0] = winLoseSenc[2];
					sentenceArray[1] = winLoseSenc[2];
					createCrown(0);
					createCrown(1);
				} else if (grades[0] > grades[1]) {
					sentenceArray[0] = winLoseSenc[0];
					sentenceArray[1] = winLoseSenc[1];
					createCrown(1);
				} else {
					sentenceArray[0] = winLoseSenc[1];
					sentenceArray[1] = winLoseSenc[0];
					createCrown(0);
		
				}
		
			}
		
		}
		
		
